(function(){
	$(function(){
		$('select, input:not(.button), textarea').focus(function () {
			$(this).addClass('highlight')
		});
		$('select, input:not(.button), textarea').blur(function () {
			$(this).removeClass('highlight')
		});
		$('a#totop').click(function (a) {
			a.preventDefault();
			$.scrollTo(0, {
				duration: 200
			})
		});
	});
})(jQuery);

